import { FC } from "react";
import { Flex, BorderBox } from "@rsbear/betsy";
import { useThemer } from "../../hooks/useThemer";

interface P {
  steps: { one: boolean; two: boolean; three: boolean };
  setSteps: Function;
}

const StepIndicator: FC<P> = ({ steps, setSteps }) => {
  const theme = useThemer();
  return (
    <Flex my="40px">
      <BorderBox borderBottom={`solid 1px ${theme.colors.dividerColor}`}>
        Properties
      </BorderBox>
    </Flex>
  );
};

export default StepIndicator;
